INSERT INTO `artical` VALUES ('1', '清明和五一贡嘎徒步新线路攻略', '清明和五一计划去贡嘎<a href=\"http://www.8264.com/list/242\" class=\"keyword\" target=\"_blank\">徒步</a>的可以参考下，年前我去过一次，完全可以走通，清明节我们有几个人计划去，有相同想法或者倾向的交流下有相同想法或者倾向的交流下聊微信手机13625749306<br />\r\n传统的<a href=\"http://bbs.8264.com/forum-5-1.html\" class=\"keyword\" target=\"_blank\"><a href=\"http://www.8264.com\" class=\"keyword\" target=\"_blank\">户外</a>活动</a>想必很多<a href=\"http://bbs.8264.com\" class=\"keyword\" target=\"_blank\">驴友</a>都玩腻了吧， 我个人带队贡嘎也不少时间了，一直觉得传统线路有一些不必要的景点完全耗时间，所以我重新规划了新路线，增加了一个勒多漫因冰川徒步和 冷噶错，取消了巴旺海和草科，<br />\r\n我们一般传统的贡嘎徒步线路是<br />\r\nD1：<a href=\"http://chengdu.8264.com\" class=\"keyword\" target=\"_blank\">成都</a>-<a href=\"http://yaan.8264.com\" class=\"keyword\" target=\"_blank\">雅安</a>-二郎山-泸定-康定-老<a href=\"http://yl.8264.com\" class=\"keyword\" target=\"_blank\">榆林</a>-电站-格西草原<br />\r\nD2：格西草原-8km-两岔河-5km-下日乌且-4km-上日乌且 <br />\r\nD3：上日乌且-6km-日乌且垭口-12km-莫溪沟尾营地<br />\r\nD4：莫溪沟尾营地-14km-冬季牧场尾-11km-贡嘎寺<br />\r\nD5：贡嘎寺-8km-下子梅村 -11KM（乘车）-子梅垭口-11KM（乘车）-下子梅<br />\r\nD6：下子梅村-巴旺海-界碑石-草科或石棉<br />\r\nD7：石棉-266km-成都<br />\r\n但是懂得地理环境的都知道，这里面有个缺点，就是太阳东升西落，所以贡嘎<a href=\"http://rizhao.8264.com\" class=\"keyword\" target=\"_blank\">日照</a>金山的观看时间并不是早上的日出而是下午的日落，卡瓦格博的日照金山是早晨，因为卡瓦格博的太阳是从人背后升起来的，刚好照到，而贡嘎的山日出时在山的背面，所以贡嘎的最佳观看时间是下午，而且莫西沟尾营地没什么景色，还有冬季牧场，这也是为什么很多贡嘎徒步游记里面没有莫西沟往后的记录和照片，<br />\r\n我认为没必要在没有景观的地方浪费太多精力，所以重新调整了下贡嘎徒步线路在大致行程不变时间不变的情况下添加了一个冰川徒步和冷噶错<a href=\"http://www.8264.com/list/950\" class=\"keyword\" target=\"_blank\">露营</a>。<br />\r\n我重新规划了这个新线路，<br />\r\n因为勒多漫因冰川很好看，我个人觉得传统的贡嘎徒步避开了这个主要的景点太浪费了<br />\r\n所以在传统线路不变的情况下把不必要的莫西沟景点和营地压缩掉，加一个勒多漫因冰川<br />\r\n其次冬季牧场啥没什么好看的，就把冬季牧场露营取消掉了。<br />\r\n传统的线路有个弊端是如果是无雪季节全程徒步什么都看不见，而且子梅垭口看日照金山如果天气不好什么都看不到，行程就没亮点了。<br />\r\n这么调整后。即便季节问题看不到雪也能看到冰川和近距离海子，这条线路我春节时走过完全可以走通并且我拍了很多有惊艳的照片，都是没处理过的，有相同想法或者倾向的交流下<br />\r\nD 1成都-康定-老榆林<br />\r\nD2老榆林-电站-两岔河-下日乌且<br />\r\nD3下日乌且-勒多漫因冰川<br />\r\nD 4勒多漫因冰川-日乌且哑口-莫西沟<br />\r\nD5莫西沟-贡嘎寺-姊妹村<br />\r\n<p align=\"left\">6：子梅垭口<a href=\"http://hd.8264.com/xianlu-11-0-0-0-1-1?from=keyword\" class=\"keyword\" target=\"_blank\">包车</a>到帮木吉德村——5KM徒步——冷噶错露营</p><p align=\"left\">D7：冷噶错—5KM徒步—帮木吉德村—包车6小时—康定</p>新线路照片:<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201803/18/0930443vkzlpbna4vdbuew.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201803/18/0930452ajd3swdr4dyxrlw.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201803/18/093048dwb7jn709wlo1cbl.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201803/20/0336195wm648bn8bn0nulz.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201803/20/033619thxggbmhef8420lm.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201803/18/093045qmzdmdv5nsc7l1hz.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201803/18/093042l8c0xeijggpi6jjc.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201803/18/093047r9mxbxgpfoc3bma8.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201803/18/093049jmpjz3uydvkqyqd7.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201803/18/0930529fyka8e5xmgd906m.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201803/18/0930562ed2tpc0aohv44ia.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201803/18/093100dbw1vcad5uxu30yl.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201803/18/0931040ntfgekmwxbspqe1.jpg!t3w825h0\'/>\r\n这三个是下午拍的贡嘎日落夕阳<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201803/18/093142hbifab37xl70cqu9.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201803/18/093142tg3ewx6cy6dig140.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201803/18/093142xdul9z6s0vgti7hy.jpg!t3w825h0\'/>\r\n遗南忘北 发表于 2018-3-19 13:12 <a href=\"http://www.8264.com/forum-redirect-goto-findpost-pid-87832541-ptid-5473732.html\" ><img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://static.8264.com/static/image/common/back.gif\'/></a>\r\n等待和你一样<br />\r\n有共同倾向？可以探讨下，我想多该几条徒步线路，毕竟现在的徒步线路都很多玩腻了。6：子梅垭口包车到帮木吉德村——5KM徒步——冷噶错露营（4500米）<br/>\r\nD7：冷噶错—5KM徒步—帮木吉德村—包车6小时—康定8264妖妹 发表于 2018-3-18 17:20 <a href=\"http://www.8264.com/forum-redirect-goto-findpost-pid-87828720-ptid-5473732.html\" ><img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://static.8264.com/static/image/common/back.gif\'/></a>\r\n清明和五一计划去贡嘎徒步的可以参考下，年前我去过一次，完全可以走通，清明节我们有几个人计划去，有相同 ...<br />\r\n6：子梅垭口包车到帮木吉德村——5KM徒步——冷噶错露营（4500米）<br/>\r\nD7：冷噶错—5KM徒步—帮木吉德村—包车6小时—康定<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201803/20/131313xg2tlr3ksfy84t0f.jpg!t3w825h0\'/>\r\n梅花冷雪 发表于 2018-3-22 10:02 <a href=\"http://www.8264.com/forum-redirect-goto-findpost-pid-87845440-ptid-5473732.html\" ><img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://static.8264.com/static/image/common/back.gif\'/></a>\r\n建议提供一下线路需要的装备清单，这样要去的人可以参考一下<br />\r\n因为 不同季节不同天气线路和装备还是有很大的改变的，所以我留了号码要去的可以互相探讨梅花冷雪 发表于 2018-3-22 10:02 <a href=\"http://www.8264.com/forum-redirect-goto-findpost-pid-87845440-ptid-5473732.html\" ><img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://static.8264.com/static/image/common/back.gif\'/></a>\r\n建议提供一下线路需要的装备清单，这样要去的人可以参考一下<br />\r\n要是瞎建议，导致人家恶劣天气去，用我建议的好天气装备预备怕误导了人家。所以我还是在这个事上保留了。<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201803/28/160727xfgfg8saqwdrgrc1.JPG!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201804/11/113524nh9ib09pvr4hhht1.jpg!t3w825h0\'/>\r', '2018-05-02 20:36:14', 'http://image1.8264.com/forum/201803/18/093042l8c0xeijggpi6jjc.jpg!w168h106', '8264妖妹');
INSERT INTO `artical` VALUES ('2', '自驾张家界凤凰：归来向人说，疑是武陵源', '【单车<a href=\"http://bbs.8264.com/forum-66-1.html\" class=\"keyword\" target=\"_blank\">自驾</a>14年40万公里，签约<a href=\"http://bbs.8264.com\" class=\"keyword\" target=\"_blank\">旅行</a>家、<a href=\"http://bbs.8264.com/\" class=\"keyword\" target=\"_blank\">旅游</a>体验师、试睡员、超级试驾员，微信扣扣569209665；微信公众号：huchichi自驾笔记本，正在直播最新行程，欢迎关注，有关<a href=\"http://zhangjiajie.8264.com\" class=\"keyword\" target=\"_blank\">张家界</a>游玩的攻略也可以咨询】<br />\r\n很多人我觉得并不真正了解张家界，因为张家界最值得一游的只有武陵源景区，也就是俗称的张家界森林公园，当然我不是说天门山和大峡谷玻璃栈道不好，它们当然也各有特色，但却不是张家界独有的特色。每个地方都有每个地方的代表，张家界的代表就是森林公园的奇峰三千，独特地貌形成的绝美景观，别说是中国，在全世界都是独一无二的。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/06/145600jilmsh3wbqbn0xeq.jpeg!t3w825h0\'/>天门山和大峡谷玻璃栈道的热门程度有点出乎我的预料，什么连夜排队买票一票难求，什么需要实名制提前预约，我觉得有时间还不如在武陵源景区多待几天，三两天时间根本玩不完。很多游客的心态实在是难以理解，怪不得都赶着节假日人山人海的去热门景区看人流呢，这审美这趣味真的让人不敢恭维，如果你是这样的游客，那就关闭页面别往下看了，我的游记真的不太适合你。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/06/145621ux24gkwsfd9pgu6s.jpeg!t3w825h0\'/>倒是有一点，我看大家都是达成共识的，就是<a href=\"http://bbs.8264.com/\" class=\"keyword\" target=\"_blank\">自助游</a>去张家界，也需要找个当地向导安排行程。因为张家界武陵源景区非常大，先不说周边的天门山、八大公山、五雷山、茅岩河等景点，就只是武陵源一个景区，就包括金鞭溪（张家界国家森林公园）、<a href=\"http://huangshi.8264.com\" class=\"keyword\" target=\"_blank\">黄石</a>寨、天子山、袁家界、杨家界、索溪峪（十里画廊）六大景区，除了这些成熟景区，还有很多没开发或刚开始被人关注的景色绝美的隐藏景点，真的值得花时间去慢慢探索。但大部分人一般只有两三天的时间，那在行程安排上想要面面俱到可能就有点困难了，必须有所取舍。此外，山上的住宿和餐饮都挺贵的，住宿还好些，吃饭贵的离谱，随便一个炒菜就三四十块，要是住几天，也是不小的开销。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/06/1456547z98kk7g0urqf5bs.jpeg!t3w825h0\'/>武陵源景区在山里，这里的天气是很难捉摸的，尤其是多余雨的季节，天气说变就变，很可能上了山，发现雾蒙蒙一片，什么都看不见。所以来这里游玩，首先是要安排好时间，然后还要看个人的运气。<br />\r\n武陵源的景点最大的特点就是同一个景点不同的时间去看到的景色完全不同，清晨、黄昏、上午、下午、晴天、雨天、雾天，同样的地方给人的感受却大不一样，即便是同一个时间，同一个地方从不同的角度看，顺光或者逆光的时候，都会有所不同。就算有详细的景区<a href=\"http://www.8264.com/ditu/\" class=\"keyword\" target=\"_blank\">地图</a>，知道所有的景点在哪里，也知道景区五个大门以及所有的交通线路，到了这里也一定会顾此失彼，不知怎样安排游玩线路才最合理。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/06/145710ozc8mae218lstbv0.jpeg!t3w825h0\'/>既然这样，那参加那种两日游三日游的旅行团怎样呢？答案当然是不怎么样，因为特别不靠谱。就先不说大家深恶痛绝的购物了，旅行社的导游带你看的都是一些常规景点，虽然就像他们说的一样，这些也确实是最值得看的，但不同的团根据自己的购物等消费安排，给你的路线都是不一样的，你肯定会错过很多值得去的景点，而原因绝不是时间不够。有一些很好的景点因为要多走路，或者对他们来说不方便安排消费行程的地方，就根本不会带游客过去。我们这次就去了以前很火，也很值得去的几个景点，例如望桥台、点将台、神堂湾等等，现在因为旅行团很少光顾，这些地方都显得有点荒凉了。所以，旅行团这种旅游方式我们根本就不会考虑。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/06/1457156emfy2ziimkrlx8b.jpeg!t3w825h0\'/>无论计划多周详，在张家界想要看到云海云雾，运气成分也是很重要的。攻略做得再细致，天气预报也不一定准，还是张家界的当地人了解张家界的天气。建议大家像我们一样找张家界当地的土家族向导小祥，按照自己的需求安排行程，也可以根据张家界多变的天气帮忙规划和随时调整行程，相当于完全的自助游，花费比自己安排行程还要便宜，还可以看到张家界最美的景色。如果运气好，赶上了雨后的云雾或云海，更需要合理地安排时间，因为美景都是稍纵即逝的。张家界山顶分为袁家界、杨家界、天子山几个区域，每个地方间隔很远，需要坐景区车很久才能到达。每个地方的海拔高度也不一样，所以云海出现的先后顺序，云雾散去的走向和时间，也都是千变万化的，只有熟悉的人才能根据时间来安排游玩顺序，争取在有限的时间看到更多的景色。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/06/145728y9odm95ykz6554tn.jpeg!t3w825h0\'/>小祥对张家界以及整个<a href=\"http://xiangxi.8264.com\" class=\"keyword\" target=\"_blank\">湘西</a>地区的景点和住宿、餐饮安排特别熟悉，本来帮我安排了三天两夜全包的行程，门票、住宿、餐饮和导游费用全部包含，因为景区的门票包含了环保车车的费用，如果不坐百龙天梯、索道和小火车，天子山有环保车直接上下山，这样在景区里面就不用再花一分钱了。但因为天气原因更改了行程，中间去了凤凰古城和芙蓉镇，又第二次入山看云海，结果非常满意。山上住宿都是在天子山的农家乐，独立卫生间、24小时热水、电视、无线网齐全，环境卫生都很好，山上吃饭都是当地农家去了现炒的菜，干净、纯天然、有荤有素，吃得饱，味道也特别好。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/06/145739t37tu7xauk05o1uf.jpeg!t3w825h0\'/>当然很多人觉得大老远来一趟张家界不容易，还是想选择更多不同的景点去看看，那么张家界的黄龙洞和宝峰湖我觉得更值得一去，因为张家界的十大绝景之中，就有黄龙洞的定海神针和宝峰湖的宝峰飞瀑。而且溶洞和湖水的景色和三千奇峰的景色截然不同，在审美疲劳之后，可以作为非常好的调剂。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/06/145809wt6au3riloxe7o2z.jpeg!t3w825h0\'/><br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/06/145821hfbi4xjrdzv0mpj8.jpeg!t3w825h0\'/>美丽的凤凰古城和芙蓉镇，有时间更应该去这里看看，芙蓉镇是挂在瀑布上的千年古镇，而凤凰古城的夜景真的是美极了。现在凤凰古城已经免票了，只要不进那些故居、祠堂、博物馆什么都，也就是所谓凤凰九景，就不需要买门票，有时间的话可以在古城多住几天。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/06/145848d5q7t81tf60st01k.JPG!t3w825h0\'/><br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/06/1459024a4x56obtns601xr.JPG!t3w825h0\'/>DAY1 抵达张家界<br />\r\n抵达张家界已经是下午，市区住的是晨天大酒店，先回宾馆放东西再去吃晚饭。小祥帮我订的比网上还便宜些，这酒店按照四星标准设计，但是整个环境和房间还是比四星略差些，算是张家界性价比很高的酒店了。建议大家来张家界进山前推荐住在市区，景区门口的武陵源镇当然更方便，而且都是比较有特色的客栈和酒店，但是价格比起市区来要贵得多了。<br />\r\n行李多的朋友别发愁，不用自己背上山，打包交给酒店托运到张家界山上预订的酒店或客栈就可以，我们去的时候只要20元一个包，自己就可以空着手悠哉悠哉地上山啦。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/030627ny44mqmxgworyrvl.jpeg!t3w825h0\'/><br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/030632uz6lxlobqw2zv23p.jpeg!t3w825h0\'/>晚餐去的乌龙山寨，就在市区附近的华天城，也是小祥推荐的，属于比较知名的<a href=\"http://hunan.8264.com\" class=\"keyword\" target=\"_blank\">湖南</a>本地连锁餐馆，总店在<a href=\"http://changsha.8264.com\" class=\"keyword\" target=\"_blank\">长沙</a>，在张家界的武陵源镇也有分店。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0306334t9s2qt34wusrzde.jpeg!t3w825h0\'/>这里的布置很别致，也很有特色，古香古色的湘西民居风格，既简单又雅致，在这种环境就餐感觉很舒服。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/030634zrhqlh9x4q46lios.jpeg!t3w825h0\'/><br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/030635p52iudi8e0h8r1hj.jpeg!t3w825h0\'/>这里当然都是纯正的湘菜，但是口味比较适中了，还不算特别辣，味道中等偏上，价格也是中等偏上，总体还是挺满意的。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/030635r5dvgcghxfiposeo.jpeg!t3w825h0\'/><br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/030636oun1ys7v153rjpwy.jpeg!t3w825h0\'/><br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0306377lmeykuvtbkbhh9q.jpeg!t3w825h0\'/><br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/030638vkawalfby1vz966r.jpeg!t3w825h0\'/>据说市区旁边山上的烈士塔可以拍夜景，吃完饭去看了看，感觉角度一般，张家界也并没有很漂亮的夜景，但如果是第一次来张家界，一定会对这座小城感觉很不错的。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/03063892t8tfchp0fgjldo.jpeg!t3w825h0\'/>DAY2 金鞭溪-袁家界-天子山<br />\r\n武陵源景区（张家界森林公园）门票248元，能玩4天，真心不贵，而且这个费用包含了景区里面的环保交通车，随便坐，招手即停，但是百龙天梯、十里画廊的小火车和所有索道，都不包含在内，是需要单独购票的。整个景区包括金鞭溪、黄石寨、天子山、袁家界、杨家界、索溪峪（十里画廊）六大景区，除了这些成熟景区，还有没开发或刚开始被人关注的很多景色绝美的隐藏景点。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/030905y64v29ma3u94qco1.jpeg!t3w825h0\'/>现在景区大力宣传黄石寨和十里画廊，其实是为了让你坐黄石寨的索道和十里画廊的小火车，这些是不包含在门票里的。当然，这两个景区也可以<a href=\"http://www.8264.com/list/242\" class=\"keyword\" target=\"_blank\">徒步</a>游玩。十里画廊，景色一般，距离也很短，要是去的话没必要坐小火车。但黄石寨的话很陡，如果不坐索道爬起来还是很累的。一直有“不到黄石寨，枉来张家界”的说法，黄石寨以前确实是来张家界玩必去的一个山头，但现在很多人都放弃了，不只是因为不想花钱坐索道，而是因为可以在袁家界的后花园和迷魂台（黄石寨的对面）看到同样的山景，就是换了一个方向。而且在袁家界这边看景色更漂亮，从体力上来讲，在袁家界这边也不需要走很多的山路。当然要是有时间的话也可以把黄石寨作为备选。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/030906t248pqfw3yiwa5uk.jpeg!t3w825h0\'/>非常建议喜欢<a href=\"http://bbs.8264.com/forum-39-1.html\" class=\"keyword\" target=\"_blank\">摄影</a>的朋友选择298元的年票，一年内可以不限次数的出入景区，而且还不用再买景区交通车票，如果像我们一样，因为天气原因中间去了凤凰古城和芙蓉镇，又第二次入山看云海，就特别划算，要是秋天有时间来看红叶，或者冬天有时间来看雪，那就更超值啦。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/030908127966qhja2rffa7.jpeg!t3w825h0\'/>因为天气非常好，所以还是选择了常规路线，走金鞭溪，然后百龙天梯上山。进入景区就是大氧吧广场，广场是很常见的，但是这样由奇峰环抱的绿地广场却不多见，在这里，就已经可以领略到张家界的神奇。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/030909jiy3i6zakdty03je.jpeg!t3w825h0\'/>大氧吧广场和水绕四门，就是金鞭溪的两头，美丽的张家界不会让你失望，一进入景区，就可以看见奇峰高耸，景色非常独特。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0309101f1w6xtsgjn8hd27.jpeg!t3w825h0\'/>金鞭溪全长六公里，大氧吧广场到千里相会，也就两公里左右，是金鞭溪景点最集中的地方，形态各异的山峰和岩石数不胜数，金鞭溪也伴随着整个游览路线，在旁边潺潺流淌。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/030912lxwe63dc3b1rj1nf.jpeg!t3w825h0\'/>神鹰护鞭，是张家界的十大绝景之一，高高耸立的金鞭岩旁，有一山峰形似鹰，头高昂，勾嘴，双翅半展，栩栩如生的地守卫着金鞭岩，似欲与来犯金鞭者拼死搏击。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/030912pim985sbdc4gzn8i.jpeg!t3w825h0\'/>师徒取经，这是个神似的景点，也是1983年版电视剧《西游记》的现场拍摄地，其中有一回《三打白骨精》全集都是在金鞭溪上游部分拍摄完成的。看这里的奇峰怪石，感觉张家界也确实像是《西游记》里面的神仙妖魔世界。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/030914ke6smofdl6xkugma.jpeg!t3w825h0\'/><br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/030914tvqyibjncavxfqq9.jpeg!t3w825h0\'/></div>', '2018-05-07 13:36:29', 'http://image1.8264.com/forum/public/20180507/5:4/152567120695.jpg!w168h106', 'huchichi');
INSERT INTO `artical` VALUES ('3', '大理--这有风有花有雪有月，还有妹纸……（大理-才村-喜洲-双廊-挖色）', '前言<br />\r\n大半年没发游记了，因为发生了很多事，工作又忙……<br />\r\n航拍高清视频已经上传，点击顶部大图就能观看……观看之后，再放背景音乐哈，特有感觉<br/>\r\n这次半工作半<a href=\"http://bbs.8264.com\" class=\"keyword\" target=\"_blank\">旅行</a>去了半个中国的很多地方，主要的目的地就是<a href=\"http://cq.8264.com\" class=\"keyword\" target=\"_blank\">重庆</a>和<a href=\"http://yn.8264.com\" class=\"keyword\" target=\"_blank\">云南</a>，彩云之南我之前来过3次，去过雨崩、梅里、香格里拉、<a href=\"http://lijiang.8264.com\" class=\"keyword\" target=\"_blank\">丽江</a>……唯独<a href=\"http://dali.8264.com\" class=\"keyword\" target=\"_blank\">大理</a>一直错过。随着，一部《心花路放》的热映，大理确实火了一把……虽然，双廊还是个大工地，到处在突击盖房子……但还是有络绎不绝的游客涌向了这里，房价也步步高，尤其是节假日的时候……<br/>\r\n这次来大理，一半是为了工作一半也是调整下自己，旅行对我而言其实没有什么太复杂的意义，你们想想，平时生活本来就很累了，难得出来玩一次还要给旅行想那么多的意义和理由，累不累啊？所以，出来玩开心就行……其他的，就见鬼去吧！<br/>\r\n这次出行……其实楼主，是和搭档一起来的……两个爷们，你想看基情……那是没的，想看，请去影院……不过搭档是航拍高手，因此还在整理这次大理的航拍素材，到时候上传后肯定是有史以来大理游记逼格最高的……然后，楼主这次来大理，也顺路给几对客户完成了婚纱照，也通过先进的各种“摇一摇”软件，约到了此次拍写真的妹纸……填了心中一直想在洱海拍写真的坑…还连租了两天的电动车，不惜晒成狗也要环海游玩一圈，看看最真实的大理……<br/>\r\n还是那句话：本人出品，必属精品！ <br/>\r\n关于我：Getty Images华盖创意<a href=\"http://www.8264.com/pp/\" class=\"keyword\" target=\"_blank\">图片</a>库签约<a href=\"http://bbs.8264.com/forum-39-1.html\" class=\"keyword\" target=\"_blank\">摄影</a>师、蚂蜂窝旅行家<br />\r\n新浪微博:<a href=\"http://weibo.com/makiori\"  rel=\"nofollow\">http://weibo.com/makiori</a> (@雍容makiori)<br />\r\n微信号：makiori<br />\r\n预告图<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/070648rbx04tzecha0u2m2.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0706486jo6mmzepcpqyphu.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/070649c935ldm6q4n780qx.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/070650umidsitaemu4oedb.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/070650b8s86wp54y15oo0a.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0706513uh4iew7qxdiase6.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0706516jegfqeotwt33fy0.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0706524byvynvvotorh1n3.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/070652r04vcwpxm4mjw59v.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0706536gudb0kat44hkt5l.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/07065377hjdbbrdnt2pc3z.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0706538jy1bdxtb7atstqx.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/070654apk9rv6igf1efsa0.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/070654zisdkjm31d2ilr8f.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/070654oc5nsqc26ars8l3w.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/070655s6vl92et1h27j2e5.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/070656h8ngb8he65awoar5.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/070656q24afde5tsoje4kc.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/070656ns0k4jtzxilosd2b.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/070657qh7lbxtzk25142zl.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/070657mgm0y7e4fe839vfu.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/070658hdurjadlc1pytk1d.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/070658yy8m2dcfd2jpei54.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/07065808p0ay9dqjk8q9xa.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/070659ixjmuxsxxfuw3xyg.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0706594fgcljooxrb2r7lb.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/070659ifl52eacyidvlu02.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/07070010cvmjjj0hglkly7.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/070700kghulfw1pc2d4ohf.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071513d4rn6wrw2mrdaw1c.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071514iacu5mor1ofhnpez.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071515dpgrt4l1dc93lwzv.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0715166gb9ea8azsmwuy0i.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0715176gydl5q5auad039k.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0715175k34ed36v60yu9py.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071518o7qxouud5td5wihb.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071518mipvimc1f09j6u0l.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071518qu6vbtofdl200dui.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071519w6ql55shchaejzov.jpeg!t3w825h0\'/>\r\n一些零碎的东西<br />\r\n【机票】：重庆直接飞丽江的……2个人好像是1200元，一个人600，还算可以<br />\r\n丽江到大理：我推荐大家坐火车……因为火车只要2个小时，而汽车需要3个小时<br />\r\n关键是，火车票的价格只有汽车票的1/3……，缺点就是只要早上和晚上有，大白天没有……很奇怪的说<br/>\r\n【住宿】：大理住宿其实也还好，就是节假日也许会紧张一些，但是只要肯找，总归还是找的到的……我们这3天，最便宜的168元，坑爹的680元，乃至好的2688元的都住了……反正提醒大家，双廊便宜的200以内的也有，好的上千的也有，提前预定会很便宜，如果临时去找说不定就会被狮子大开口……<br/>\r\n【吃饭】：这个随意，我反正是看到啥感兴趣的都去尝尝，当然最吃的习惯的还是KFC<br/>\r\n【行程】：说实话大理三天足矣，一天古城，一天双廊，一天喜洲……三个地点，中间可以<a href=\"http://bbs.8264.com/forum-66-1.html\" class=\"keyword\" target=\"_blank\">拼车</a>，也可以租用电动车……拼车的话，古城到双廊是25元一个人……<br />\r\n然后，可以在当地找电动车……一般小的40元一天，大点的50元一天，都是押身份证…<br />\r\n…缺点就是你哪借的只能哪里还……有点不方便<br/>\r\n所以如果你行李不多的话，推荐你去借铁马驿站的电动车，因为有很多点，可以不同的点借车或者换车，这样自由度大大的增加了……<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0715193ncssm0500dcsd9c.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071519vzjh2v0q0bcaltb7.jpeg!t3w825h0\'/>\r\n关于摄影<br/>\r\n〖机身〗： D800；<br />\r\n〖镜头〗：尼康大三元系统<br />\r\n    14-24.24-70.70-200，对于这三镜头没啥好说的……太重了……没办法<br/>\r\n〖摄影附件〗： <br />\r\n三脚架<br />\r\nSB800 SB700 永诺568<br />\r\nB+W77mm CPL；<br />\r\nLEE 150x170mm 0.9 soft 渐变滤镜GND； <br />\r\nLEE 150x150mm 0.9 ND滤镜； <br />\r\n史钛龙150 插片滤镜系统+77口径转接环；<br />\r\n品色无线快门 （主要用于自拍）。<br />\r\n32GCF卡<br />\r\n64GSD卡<br />\r\n各种色片、柔光伞和道具反光板<br/>\r\n关于着装<br />\r\n必须穿长袖……并且带帽子和墨镜，太阳真的非常的厉害……尤其是骑电动车的时候<br />\r\n如果你不想被晒成狗……就严严实实的<br/>\r\n各种防晒霜和补水面膜，润唇高是绝对要必备的，此外还有墨镜……总之“保湿”的一切相关产品，什么面霜啊，面膜之类的，能带上全都给它们带上<br/>\r\n其他用品：<a href=\"http://bbs.8264.com/forum-forumdisplay-fid-7-typeid-1172-filter-typeid.html\" class=\"keyword\" target=\"_blank\">睡袋</a>、<a href=\"http://bbs.8264.com/forum-forumdisplay-fid-7-typeid-1163-filter-typeid.html\" class=\"keyword\" target=\"_blank\">冲锋衣</a>、 <a href=\"http://bbs.8264.com/forum-forumdisplay-fid-7-typeid-1163-filter-typeid.html\" class=\"keyword\" target=\"_blank\">冲锋裤</a>、塑料袋若干、小工具一套、<a href=\"http://www.8264.com/list/218\" class=\"keyword\" target=\"_blank\"><a href=\"http://www.8264.com/list/218\" class=\"keyword\" target=\"_blank\">手电</a>筒</a>、水杯、防晒面巾/口罩<br />\r\n<a href=\"http://bbs.8264.com/forum-forumdisplay-fid-7-typeid-1183-filter-typeid.html\" class=\"keyword\" target=\"_blank\"><a href=\"http://bbs.8264.com/forum-24-1.html\" class=\"keyword\" target=\"_blank\">登山</a>鞋</a>、拖鞋、皮鞋<br />\r\n学生证、身份证<br />\r\n快干裤、牛仔裤、长袖上衣、开衫、卫衣、一次性内裤、防晒衣、打底袜、围巾、裙子<br />\r\n帽子、墨镜、伞、口罩、面巾、一次性雨衣<br />\r\n湿巾 纸巾 卫生纸 卫生巾、护垫<br />\r\n零钱包、<a href=\"http://www.8264.com/list/207\" class=\"keyword\" target=\"_blank\">背包</a>、小包、钱包证件包<br />\r\n食品：巧克力 牛肉干 口香糖 <br />\r\n数码：相机、充电器、电池、手机电池、接线板<br />\r\n药品：感冒药、止泻药、发烧药、胃药、创可贴、酒精棉片、西瓜霜、喉糖、金莲花<br />\r\n护肤品：洗漱用品，防晒霜（50倍以上），唇膏，护肤霜，卸妆油、护手霜、面膜、驱蚊水、洗面奶、化妆棉、洗发水护发素沐浴露<br />\r\n小公仔、便笺、笔<br/>\r\n最后关于背景音乐<br/>\r\n安和桥……宋冬野的，最近非常的火<br />\r\nD1 大理古城<br />\r\nD1：从丽江坐了3个小时昏昏欲睡的大巴后，汽车终于在下关车站嘎然停止……<br />\r\n然后花了3个小时，结束了在大理的工作后，我终于有3天时间来好好填上这个我曾经错过的坑……3年前，我组织的梅里雨崩团去了 丽江以北所有的景点包含泸沽湖……因为时间原因，错过了大理，错过了双廊……也许3年前的大理还没这么商业……也许有的地方，都是趁早去比较好……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071520btm3nc9yagncq7xt.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0715206fg2g6daoj4kb8sr.jpeg!t3w825h0\'/>\r\n云南的气候是我非常喜欢的，清新的空气彷佛能洗肺，风吹在身上非常的干爽……需要时不时的补水，虽然这里还不算高原，但千万别小瞧这里的紫外线，不做防护措施，2天就能把你晒成狗……<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071521q07vxjjzarftch75.jpeg!t3w825h0\'/>\r\n这是在大理市里，洱<a href=\"http://hainan.8264.com\" class=\"keyword\" target=\"_blank\">海南</a>边的洱海公园拍的3张照片……太阳当头照，这里也是大理人晚上散步锻炼的地方……<br/>\r\n其实，搭档在大理有当年玩魔兽世界的战友，因此此次面基分外的亲热，安排我们在古城内吃了一顿云南当地的特色菜，还带我们去古城的夜场酒吧……可惜我没带相机，就用文字表述下吧，首先云南特色的乳扇，对于味道我还是蛮喜欢的，就是这个嚼起来的口感有点考验牙齿，然后酒吧街的氛围还是很嗨的，而且晚上过了11点是强制不允许在大声放音乐唱歌表演了，这点我是很喜欢的，毕竟我更喜欢的是朋友间的聊天吹牛海喝，而不是让表演音乐来主导……结束后，还继续吃了夜宵，一直到凌晨2点才尽兴而归<br/>\r\n搭档的基友，还带了2位当年也玩魔兽世界的警察叔叔来聚会，其中一位是缉毒警察，听着对方在云南曾经办案的经历，真的是非常的惊险刺激，确实辛苦又危险……赞一个<br/>\r\n一觉睡到天亮，那就不浪费时间赶紧闲逛吧……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071521an4xubkvw51r7xp8.jpeg!t3w825h0\'/>\r\n我们就住在古城靠近洱海的东门的风花雪月大酒店里，关于酒店的情况后面来介绍……反正搭档的基友开了挂，价格太给力了……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0715224ukal8ak2tvrllld.jpeg!t3w825h0\'/>\r\n古城的人民路是一条主干道，也是步行街……从东门走到人民里大概需要走不到2公里……<br />\r\n还是有点距离的<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071522s85w375rhbmzw7kx.jpeg!t3w825h0\'/>\r\n其实，大理古城虽然没丽江大，但其实也不小，走在马路上，看着蓝天白云，心里一阵自在，毕竟这里的云非常的低，很有气势<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071522zc3kxzgyxoj0gwkm.jpeg!t3w825h0\'/>\r\n没走几步路就看到了大理古城准备收古城维护费的公告，打算自2015年9月1日开始，对当地的旅行行业征收一定的费用，例如，旅行社按游客人头按一人30元征收，我想这笔钱肯定是羊毛出在羊身上，还是会转嫁给游客的……不过，散客没事……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071523t5f6mhvffesdny4q.jpeg!t3w825h0\'/>\r\n看着祖孙出来一起出来玩，就能感觉到这不仅仅是古城的传承，也是当地人生活的一种接力……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071523vh18bke8cl2jlhw3.jpeg!t3w825h0\'/>\r\n道路的两边，也是都有水渠的……这在所有的云南的古城基本上都是一个标准配置了<br />\r\n古城充分利用泉水之便，在城中一分为三，三分成九，再分成无数条水渠。使古城清净而充满生机<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0715232e6ll25dawi2rz5k.jpeg!t3w825h0\'/>\r\n如果，你觉得走着累的话，古城有图上的这种电瓶车可以做，2元一次，可以经过古城几个比较重要的景点……省事<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071524ys1yyj9md2zfhy4m.jpeg!t3w825h0\'/>\r\n这里就是大理古城的人民路了，我抵达的时候正好是节假日的第一天，路上都是全国各地来往的游客，分外的热闹……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071524lsb4xr4rbylt24c2.jpeg!t3w825h0\'/>\r\n可以说，虽然古城也被商业化运作了，但是总体而言和丽江 凤凰相比，这里还是相对淳朴了点……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071525m1djwxtl0yxom0cu.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071525z60sg5r9jxzabxcg.jpeg!t3w825h0\'/>\r\n这里就是一个坐电瓶车的点，大理电影院……看着这个很有历史气息的电影院，忍不住就想起了童年时候，电影院的模样……很带感<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071526i45d4hyjmv3xgtfe.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071526y2ybz1axfrw1a6mv.jpeg!t3w825h0\'/>\r\n如果走的累了，沿着水渠旁边会有很多椅子，可供游客小歇，在这里吃吃冰激凌，看着往来望去的人，静下心来，哪怕也就十几分钟……你也能感受到一份安然和淡定，以旁观者的角度看着这个世界<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071527ui8j4m26ndgpzlyw.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/07152761e6mz8vphgopr1s.jpeg!t3w825h0\'/>\r\n这里就是古城的洋人街了，晚上这里的老外非常的多……多是酒吧<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071719mq0thdfrskojxhoq.jpeg!t3w825h0\'/>\r\n在古城，大理洋人街原名“护国路”，意为民国初云南人民反对袁世凯称帝，起兵护国而得名。后来，护国路便成为外国游客在大理的集散地，随着<a href=\"http://bbs.8264.com/\" class=\"keyword\" target=\"_blank\">旅游</a>业的发展，游客日渐增多，中西风味店、茗茶坐、珠宝店、古董店、扎染店、画廊，各行各业随之兴起，铺面林立两侧，满目琳琅，目不暇接，成为中外有名的大理洋人街。<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071719t71vq2zos059rl9j.jpeg!t3w825h0\'/>\r\n白天，你在这里基本上看不到几个老外，多是卖东西的小商铺，从衣服到首饰，再到银饰……应有尽有<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071721fzywhf4najlcwj1q.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071721p8blanrbv4rhims0.jpeg!t3w825h0\'/>\r\n由于是白天，酒吧人比较冷清，到了晚上这里可就热闹的紧了……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071722zdut1iup9weqtfgf.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071722v63c7wx1ozi0ljry.jpeg!t3w825h0\'/>\r\n走在古城里，除了抬头的蓝天白云，可千万别错过了当地的人文……古城仍旧生活了不少当地的原住民，很多老阿婆仍旧会在古城中央去买菜<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071722qe79hn6f5jebc6i7.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071723bljas3ab4263x9d5.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0717230pgommbl2nruzitu.jpeg!t3w825h0\'/>\r\n烤乳扇遍地都是，我觉得都差不多……尝尝就行<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0717236sai63telvpj9bxa.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071724fh4on5ujh2n05y64.jpeg!t3w825h0\'/>\r\n走出洋人街，继续往南走，就到了大理古镇的四方街了……这里也是最热闹的地方<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071724w1ib8wlrctk2nawu.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071725nnjxr914yhpq2pbr.jpeg!t3w825h0\'/>\r\n在这里，每天上午不少老阿婆都会在这里摆摊卖菜，都是当地特色的东西……我很喜欢，因为这样才觉得有味道……而不是冷冰冰的感觉<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071725illgs5sstkvnxmau.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071725g4bcihqbe38p2lgs.jpeg!t3w825h0\'/>\r\n当看到下面几张图的时候，这里就是人民路和复兴路的交汇处，也是最繁华的地方……<br />\r\n麦当劳，ICBC，各种乳扇，鲜花饼，等等……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071726qoj9gxan1vhur1za.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071727h1b9gw1z4uveeidk.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071728523cx6h6eork68sl.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071728pqoyk23tibg5mvmt.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071729sczxxa18tjg5wqzc.jpeg!t3w825h0\'/>\r\n由于，气候实在是宜人，这位大叔直接就不雅的睡在了椅子上……文明啊……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071729knwz4nhvfv9w0r9e.jpeg!t3w825h0\'/>\r\n水在古城里流动，给古城带来了勃勃生机……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071730lufgb5f2to26y18k.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071731f5s684p6c5o5asim.jpeg!t3w825h0\'/>\r\n继续往南走不远，遥远就能看到五华楼了……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0717312hgzpfnb20c26qpy.jpeg!t3w825h0\'/>\r\n仍旧是靠乳扇，5元一串……不喜欢羊奶的人可以PASS了<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071731xn8qcu7fq9je765c.jpeg!t3w825h0\'/>\r\n这个城楼就是五华楼了……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071732trieafx3f4act8l2.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071732h1sa2filtfxi7hba.jpeg!t3w825h0\'/>\r\n 大理古城的建筑为清一色的青瓦屋面，显得十分的古朴。在历经1200多年沧桑的古城中央，四亭拱托、清流环绕的一座宏大精美佳构就是南诏、大理国历史上著名的五华楼。<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0717338t047vkale5np38u.jpeg!t3w825h0\'/>\r\n古时五华楼是官方聚会宴请贵宾的地方，高达五层，可容万人站立。但在历史上五华楼几次焚毁又几次重建，走过千年沧桑。<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0717334d5vb48hpgoj4uzr.jpeg!t3w825h0\'/>\r\n现在的五华楼是1998年重建的，是一座高二十多米的四层建筑，下面的一层为台座，上面的三层为楼。五华楼是大理古城的标志性建筑之一，精美瑰丽让人赞赏。<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071733b2dj0dj2a0nibdto.jpeg!t3w825h0\'/>\r\n五华楼底下也是有好几家店铺，上楼的通道也是在店里……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071939b70de0abxl369f2c.jpeg!t3w825h0\'/>\r\n可是我去的时候，通道里铁将军把门……不能上去……郁闷的<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071940k3sc4zxmnd0cgonz.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071940hfkdbcy3890dumqg.jpeg!t3w825h0\'/>\r\n五华楼的四周是和荷花池……非常的好看，躲在太阳背面……很凉爽<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071941wqb9aasysmdx97ca.jpeg!t3w825h0\'/>\r\n如果能静下心，好好的观察下亭子的结构和上面的花纹也是一件有意思的事情<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071941bmqdnk5tkrd70vvv.jpeg!t3w825h0\'/>\r\n然后继续在古城里瞎转悠……走到哪是哪<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071942x6mudsd4v01yok41.jpeg!t3w825h0\'/>\r\n古城是正方形结构……东南西北四个门……所以不用担心迷路<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071942t64nyywtqb1qtzp5.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071942eju5pwulrs0y2ltm.jpeg!t3w825h0\'/>\r\n虽然不知道这些老阿婆卖的是啥菜，但我觉得 我肯定是吃不惯的……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071943ckcoim4zuzk2ct40.jpeg!t3w825h0\'/>\r\n好了说说古城住的地方吧……风花雪月大酒店……这个在大理无人不知的酒店<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071943f44fg75bb3vq6uhw.jpeg!t3w825h0\'/>\r\n地理位置非常的好，就在古城的东门这里靠近洱海……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/07194379ut2iob2ca6syse.jpeg!t3w825h0\'/>\r\n房间是通过搭档的基友订的……因为基友的老妈在这里有股份……所以原价2688元的房间……400元就我们一人一间住了…………是不是很给力？哈哈<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071944bpntng1s94kczilt.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0719449v7hds858j04gci7.jpeg!t3w825h0\'/>\r\n浴室非常的大，可以好好的泡一泡<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071944598xw0blk3zo663s.jpeg!t3w825h0\'/>\r\n主要是床大……一个人睡有点浪费……哈哈<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071945v1wsa9swt6dxip3o.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071945p4ld64c7ukd4devu.jpeg!t3w825h0\'/>\r\n客厅非常的大……绝对适合一家三口过来玩<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0719461fjttykot04edtxs.jpeg!t3w825h0\'/>\r\n这是酒店内的庭院……时间一到自动喷水<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0719475x2lkk3nkndrmec1.jpeg!t3w825h0\'/>\r\n崇圣寺三塔<br />\r\n从大理古城去三塔非常的近……出租车也就15元，一般司机是非常乐于载你过去的，因为如果是散客的话，去三塔买门票的话，可以每人提成30元……所以，司机非常积极的说<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071947v7uo9qlcy84k52r7.jpeg!t3w825h0\'/>\r\n三塔门票是121元，我去的时候，这个横幅太煞风景了……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/07194750iarn0ty5pu1hkj.jpeg!t3w825h0\'/>\r\n这里是大理历史上规模最为宏大的古刹，南诏丰佑年间曾有殿宇千间，大理国时期是皇家的寺院。<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071948a759826raetpoicd.jpeg!t3w825h0\'/>\r\n崇圣寺三塔由一大二小三阁组成。大塔又名千寻塔，当地群众称它为“文笔塔”，通高69.13米，底方9.9米，凡16级，为大理地区典型的密檐式空心四方形砖塔。南北小塔均为十级，高42.17米，为八角形密檐式空心砖塔。<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071948si9pcwiljy2a1hgg.jpeg!t3w825h0\'/>\r\n三座塔鼎足而立，千寻塔居中，二小塔南北拱卫，雄伟壮观，显示了古代劳动人民在建筑方面的卓越成就。1961年3月4日，被国务院公布为第一批国家级重点文物保护单位。并列为5A 级景区。<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071949subu8g6v9uuer4lq.jpeg!t3w825h0\'/>\r\n俗话说，万丈高楼平地起。高入云霄的大理崇圣寺前三塔，也是由一块砖、一块砖垒砌而成的。而塔砖却与众不同，上面布满了佛教密宗的各种各样的梵文和汉文的经咒。<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071950dos2fmiv0qc38jf9.jpeg!t3w825h0\'/>\r\n历经千年沧桑和风雨剥蚀，崇圣寺毁于清咸丰年间，西三塔却巍然屹立。1925年地震，塔顶地震，塔顶震落，残破益重。建国后政府对三塔保护十分重视，1978年对其进行了大规模维修。<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071950g07rhrwsf3mooput.jpeg!t3w825h0\'/>\r\n既然，都来了当然要撒野飞一下啦……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071950o9jrnoe0vmhg2wck.jpeg!t3w825h0\'/>\r\n看……我是托塔天王转世…………<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071951irit0z8zrv4ctlmi.jpeg!t3w825h0\'/>\r\n下面是航拍镜头<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071951ajjkrhh5vlurzqoz.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/071952gj7oq4iw31hj9wm2.jpeg!t3w825h0\'/>\r\n后面的寺庙其实离三塔还有一段距离……而且寺庙面积也是非常的大<br />\r\n可以在下面花30元买电瓶车直接到最高处，再一层层下来……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0719525ac3xzwfgqa91098.jpeg!t3w825h0\'/>\r\n2005年4月崇圣寺大规模恢复重建竣工，结束了崇圣寺三塔近百年来“有塔无寺”的历史，形成了塔寺辉映的美景。<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072417pqhqn9z2j50faprq.jpeg!t3w825h0\'/>\r\n崇圣寺的规划布局以保护三塔为核心，源于历史，超越历史，借鉴了国内外著名寺庙布局的特点，集唐、宋、元、明、清历代建筑特色之精华，按主次三轴线，八台九进十一层次进行规划建设。<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0724190gcwryi2ybbdk1qx.jpeg!t3w825h0\'/>\r\n主轴线上依次建有大鹏金翅鸟广场、山门、护法殿、弥勒殿、十一面观音殿、大雄宝殿、阿嵯耶观音阁、山海大观石牌坊、望海楼。中轴线两旁和次轴线上建有法物流通处、方丈堂、客堂、斋堂、罗汉堂、千佛廓、祖师殿、佛教研究院。<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072422qwnopak1bzknpj9j.jpeg!t3w825h0\'/>\r\n寺内塑像以《张胜温画卷》、明代梨广修所塑的“五百罗汉像”和三塔出土文物为蓝本创作而成，融合了“禅宗”、“密宗”的特点，形成独特的大理雕像风格。<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/07242397f852m5typ19ggy.jpeg!t3w825h0\'/>\r\n寺内建筑主体以钢混结构为主，斗拱门窗及细部装修采用优质的红椿木精雕细凿，中轴线建筑采用最高规格的金龙金凤和玺彩，两次轴线采用庄重典雅的旋子彩，廊阁内院采用活泼诙谐的苏式彩，整个建筑起伏跌宕，错落有致、金碧辉煌、气势磅礴，而又不失民族特色；<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072424c837wxwda3dax9l9.jpeg!t3w825h0\'/>\r\n木雕艺术如《张胜温画卷》长卷、佛本身的故事、观音十八变等，格调高雅，独具匠心，堪称珍品；石雕艺术形态各异、活灵活现。整个建筑、彩绘、雕塑风格与寺内清新秀丽的绿化美化，熣灿耀眼的灯光艺术相融合，营造出崇圣寺浓厚、庄严的佛教氛围，堪称现代佛教寺院的典范。<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0724257hrmck1kmu1b15rp.jpeg!t3w825h0\'/>\r\n我们去的时候正好是正午时分，因此除了旅行团也没几个人……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0724266c6xa4v89idvhgca.jpeg!t3w825h0\'/>\r\n非常喜欢大理的云，和蓝天配合的非常有默契，恰到好处的和下面金碧辉煌的寺庙遥相呼应<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072426imad6xztk0ln4ibb.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072427h6yr8d745ts23i5c.jpeg!t3w825h0\'/>\r\n一路沿着台阶下来，非常的愉悦……回头遥望大雄宝殿，笼罩在一层云势底下<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072427ry5qoi8b3zcr36wk.jpeg!t3w825h0\'/>\r\n抓住机会，赶紧飞了下……非常的壮观<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072428fnaq3e1wzafz7g5b.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072428i2dyn7xmftjwe81k.jpeg!t3w825h0\'/>\r\n玩好后，就回酒店休息睡觉……晚上继续吃饭，瞎逛……<br/>\r\nD2 大理古镇-环<a href=\"http://haixi.8264.com\" class=\"keyword\" target=\"_blank\">海西</a>路-喜洲-海舌公园<br />\r\nD2，其实也算是半个工作日……因为，正好约了几对小夫妻在风景优美的喜洲拍婚纱照，这里大概是整个大理除了双廊最适合拍照的地方了……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0724289i37z25k573xotpc.jpeg!t3w825h0\'/>\r\n沿着环海西路走，迟早会发现这两颗有名的夫妻树……如果早来几个月的话，两边的树叶还是不同的颜色呢<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072429bwr3qbsvyle14hbi.jpeg!t3w825h0\'/>\r\n这里也是拍写真，拍婚纱的好去处……看上图的小夫妻跳的多嗨啊……别告诉我，你没看到人哈……这是目前流行的广角风光环境人像……人就是一点点大哈<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072440re4n56vewecv8gt0.jpeg!t3w825h0\'/>\r\n沿着环海西路往海舌公园走……两边的植被非常的茂密<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072452g7j9aanrfr6loruh.jpeg!t3w825h0\'/>\r\n海舌公园是免费的……里面可以戏水非常的时候游玩和拍照<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072455nl307ov54sce91f4.jpeg!t3w825h0\'/>\r\n走进去就道路两旁竹子能够遮阳……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072456fbqm50a8dghbgv3c.jpeg!t3w825h0\'/>\r\n这里可以特别关注一些树的形状……好看的话很适合拍照<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/07245677a8vhb2knupzglh.jpeg!t3w825h0\'/>\r\n找到合适的地点，我们就可以开拍了……虽然光很强烈，也比较硬……但是看着背景的蓝天白云，以及周围的碧水，光环境就很值得出片了<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072457i87yhf5wqdz58egl.jpeg!t3w825h0\'/>\r\n找到合适的近水的环境，也是不错的……只要新娘的裙子拖尾够大，就能彰显出高大上的感觉<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072458cl2uly67lts8lkwl.jpeg!t3w825h0\'/>\r\n当然，实际拍摄的时候是上图这样的……周围也还有玩的嗨的大妈<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/07245807fya2h99ujuov7m.jpeg!t3w825h0\'/>\r\n通过引导，渐入佳境了后……整个画面也会活泼有趣了起来，就放这几张吧……给大家过过眼瘾哈<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072459i79a2fwzrbyxppqq.jpeg!t3w825h0\'/>\r\n周围，也有不少游客带着孩子过来嬉水……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072459gqdypg4zd8nu55ra.jpeg!t3w825h0\'/>\r\n拍摄中途休息的时候，还好我穿的是凉鞋，可以一脚踩进水里，慢慢的在水里走动，水温比较的凉爽……非常的宜人<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072459kvd4nlsdius7u6bx.jpeg!t3w825h0\'/>\r\n在不远处的水塘这里，几个年轻人在集体做海贼王的手势……青春就是好<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072500rrnuvyb52r3oxczj.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072500ix0aaqz7lo3r0wtv.jpeg!t3w825h0\'/>\r\n这里其实也是蛮适合倒影的……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0725021vy5km2vs5kw9q68.jpeg!t3w825h0\'/>\r\n周围的水边都长满了水草，过去要小心淤泥<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072502uhs59xw9nxad4cuv.jpeg!t3w825h0\'/>\r\n走到底端我非常的喜欢这块水域，因为这里有石头可以踩在上面站在水中间……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0725027uyr4kl9cozc7555.jpeg!t3w825h0\'/>\r\n我也抓住机会，臭屁的给自己来几张到此一游……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072947hch0xjobv4f8dv51.jpeg!t3w825h0\'/>\r\n如果，你沿着洱海游玩，你会发现不少洱海沿岸村子的小孩都非常的喜欢游泳，水性极佳<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072947yro33meyejauk5hk.jpeg!t3w825h0\'/>\r\n上图的这位仁兄就非要表演一段跳水给我看……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072948zj6vuynqc5hmwwas.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072948yw389pb5ljmg0da1.jpeg!t3w825h0\'/>\r\n就是这个姿势实在不够优美……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0729492cjb1lux2978tvff.jpeg!t3w825h0\'/>\r\n继续跳第二次……更加的难看了……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072949caywoelq6id9szbo.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0729500zytzklirjq0dt92.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0729504crv1lcom82ujlaj.jpeg!t3w825h0\'/>\r\n可以说海舌公园还是比较值得来玩玩的……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072950dvmu4i4mgirky24p.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072951q2xqqufkxbzaozwy.jpeg!t3w825h0\'/>\r\n沿着岸走……你可以自己挖掘一些路线……和景色<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/07295187ywjeoh2pc66tjy.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0729514czuc0cqson1vhz5.jpeg!t3w825h0\'/>\r\n结束完，当天的婚纱拍摄后……还有3个小时才天黑……因此，我打算租电动车回古镇……<br />\r\n但是，如果是在喜洲租的话一般只能在喜洲还，很不方便……还好，通过打听，才知道了铁马驿站这个好东西<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072952kuzft89j21tp330l.jpeg!t3w825h0\'/>\r\n这就是大理唯一一家支持异地租车还车的铁马驿站了，这是蝴蝶泉站……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072952mqq9h0a1mjydahla.jpeg!t3w825h0\'/>\r\n办理好手续后，我就可以租着这车开到大理古城直接在那还车了，很方便<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0729537fp1o14c4ipz9bqe.jpeg!t3w825h0\'/>\r\n现在是我一个人的悠闲时间……我非常喜欢这种听着音乐，迎着风，享受着阳光和空气的感觉……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072953jn7y8d6e3u9sufb9.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072953948b8ydmfo4146or.jpeg!t3w825h0\'/>\r\n速度加快，彷佛整个人都愉悦到要飞起来似的……这是一种心的放松和放飞<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0729543ch9z87g9yydho12.jpeg!t3w825h0\'/>\r\n所以，在大理你不租车沿着洱海兜风的话，那就100%白来了<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0729544htfdk2eskuqnv3t.jpeg!t3w825h0\'/>\r\n路上，突然看见一辆电动车上5个当地的骚年……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072955nqxaxv31t67gz946.jpeg!t3w825h0\'/>\r\n这个技术真的赞一个……骚年们都是去游泳的……看见我的镜头，对我抬起来的V字<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072956l3xxfdsyxjv6nu7z.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072956oicscfc6i2txi990.jpeg!t3w825h0\'/>\r\n沿着环海西路到大理古镇从蝴蝶泉出发，大概是40公里不到……小型的电动车都够<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072956epep0bwpagpcrqa8.jpeg!t3w825h0\'/>\r\n骑着电动车的好处就是，看见喜欢的景色随时都能停下来……好好下去拍拍<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072957biqdp8vy7xb5hi9p.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072957szmq05afzwwoqr2x.jpeg!t3w825h0\'/>\r\n这里不少风景优美的地方，都能直接跳进湖里好好玩……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0729583vl8pncag3p94e5d.jpeg!t3w825h0\'/>\r\n不少游客都是带着孩子跑过来，感受下平时玩不到的乐趣<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072958cjahuwqjyezor27s.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072958kehqthegaijtgou3.jpeg!t3w825h0\'/>\r\n洱海沿岸植被十分的旺盛，经常都能找到一块绿地可供歇息<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072959vj7wj1o54cji4f70.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/072959lxlxu9752g9e7xzm.jpeg!t3w825h0\'/>\r\n马路上随处可见电动车……主要停好就没事<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073310u6au0iyh04725wyh.jpeg!t3w825h0\'/>\r\n给自己照一张自拍……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073311xjz3lmaaokzgkfog.jpeg!t3w825h0\'/>\r\n道路的指示牌非常的简明扼要，基本不会迷路……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073311zevc5iglpowsdupy.jpeg!t3w825h0\'/>\r\n白族人特有的壁画……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073312yoq7134wdram0zx1.jpeg!t3w825h0\'/>\r\n找人也自拍下……注意我手上的女士袖套……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073312sslsl9pq6g5ue2dr.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073312i0jl0wfyqtjd6he5.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073313vc1lmt3w5kaieqfn.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073313wcf9ytk4sdhxpb6x.jpeg!t3w825h0\'/>\r\n一路的风景都是如此如诗如画，水非常的清澈，天也是如此的碧蓝<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0733149ka0nwg45isi7a50.jpeg!t3w825h0\'/>\r\n如果，骑的累了也可以找个树荫处休息下……也会很惬意<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073315lvgew6khhqbity20.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073315vfelwc51p7vp76kj.jpeg!t3w825h0\'/>\r\n这就是我在路上花8元买的防晒袖套……不得不买了<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073315gez3w3z4zfmndtoi.jpeg!t3w825h0\'/>\r\n这边的孩子水性都非常的好……遥遥望去，这是要殉情？<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0733163hmrlc6pul9n6k3y.jpeg!t3w825h0\'/>\r\n突然，我从路边发现这几颗长的比较有个性的树木<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0733169ngz7scgzsdv4bst.jpeg!t3w825h0\'/>\r\n我当时在想，如果正好有人站在中间那个木桩上绝对是大片了……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073316g9ngx8caa0tfzvnp.jpeg!t3w825h0\'/>\r\n正好，旁边有个骚年想下去游泳，看见我的镜头，害羞的让我不要拍，可这并没有什么卵用，我还是拍了……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0733173zye1vkoxud2r1do.jpeg!t3w825h0\'/>\r\n看着，骚年远去的背影，这是感叹青春真好……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/07331769c62dfqowbdm6tt.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073317x23xoi74r40s9gp7.jpeg!t3w825h0\'/>\r\n这个地方，下次肯定还要再来<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073318ati7rzjd4r682j32.jpeg!t3w825h0\'/>\r\n然后，继续前进，你会发现沿岸有很多码头，停放着很多渔船<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/07331830r1fil6lr7ya44b.jpeg!t3w825h0\'/>\r\n由于，现在是禁渔期，所以不准从事打渔的工作，要等到冬季才能开捕<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073319opuqjwy8a6nqarzm.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073319m8duy71prmqk7vlt.jpeg!t3w825h0\'/>\r\n我当时在想，能在这里三天打渔两天晒网，也未尝不是一件幸福的事情……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0733199hln2g0n0zgay2rt.jpeg!t3w825h0\'/>\r\n转眼间，40公里不到就又回到大理古城了……还车后，继续去吃饭休息……明天就准备去双廊了<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073320qxsryre4hgxjhlek.jpeg!t3w825h0\'/>\r\nD3 大理古城-双廊<br />\r\n今天是去双廊的日子，收拾好行李check out后，我们就找了辆黑车去双廊25元一个人，这里的司机都是喜欢坐满了人才发车，所以一定要看清楚车上已经有多少人了。双廊现在还是个大工地，到处都在突击盖房，修路挖水管……非常的乱，好看的也只有沿洱海的那一面旅馆。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073320n6ejxn6os46w10yq.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073320uznp6vvs15ssf2xd.jpeg!t3w825h0\'/>\r\n由于没有提前预定，临时打电话找的客栈自然给你狮子大开口了，标间680元，一问旁边提前半个月订的小妹也就300多……实在是……哎<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073321de30niw6cb8fs0ki.jpeg!t3w825h0\'/>\r\n收拾好行李后，我和搭档快步先走到双廊的必去之地--海地生活<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073321lbgoq7i3v4dpd166.jpeg!t3w825h0\'/>\r\n说实话，去海地生活要在巷子里绕好几个弯……然后你就能找到海地生活了<br />\r\n海地生活目前已经有五个馆了，其中1 2 3是普通的青年旅社……而4 5是比较精品的馆的<br />\r\n说实话，1000多一晚的价格在端午节乱开价的大体环境中，还是觉得可以接受的……<br />\r\n可惜，全部订满了……不然我和搭档肯定去住……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073322klb7wiierx2dmoby.jpeg!t3w825h0\'/>\r\n下图，就是这个有名的自拍装逼圣地……拍照需要排队……从早上7点开始，就络绎不绝的来自拍了……哎<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073322o1rzb2wvjzhzy18x.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073611kjmmz6yfyyssek6i.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/07361151mspz6ce6y4sc5g.jpeg!t3w825h0\'/>\r\n海地也提供餐饮服务，4个人几个菜也就200元，还算可以……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073612aahns42d4b6wwyem.jpeg!t3w825h0\'/>\r\n在这里，从东边一望无际的遥望整个双廊……视野非常的开阔<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0736128r7o5cj80iz3xaw5.jpeg!t3w825h0\'/>\r\n这里也是各种情侣秀恩爱的场所……不过，秀恩爱死得快哦<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/07361225755ac1zje0clxe.jpeg!t3w825h0\'/>\r\n好了，下图就是这次约在海地见面的模特啦……来自<a href=\"http://chengdu.8264.com\" class=\"keyword\" target=\"_blank\">成都</a>的小耳朵……目前大一<br />\r\n和高中时候的闺蜜，相约出来旅行，然后赶紧再跑回成都学校去期末考试……实在是太任性了……我喜欢！<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073613bz6ptymnpw1c6gbf.jpeg!t3w825h0\'/>\r\n然后，趁着太阳还没下山，光线非常的好…就赶紧拍吧<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0736138e7i3rc85hs44pk0.jpeg!t3w825h0\'/>\r\n小耳朵是典型的川妹子……娇小玲珑，镜头感非常的好……对于，摄影师而言这是最理想的模特……少许的引导就能得到非常好的镜头<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073613k5xj09v0f7oeeqp1.jpeg!t3w825h0\'/>\r\n这是当时的光线环境，太阳已经下山中……光线已经开始变得柔和了，这也是拍人像和风光最合适的光线<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0736148g2a73ei7u58a26e.jpeg!t3w825h0\'/>\r\n好了，正式开拍……因为，洱海给我的感觉是相当小清新的，所以在调色方面我是偏淡蓝色的日系感觉去调整的……最后，给我的感觉非常的满意<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073614v2mz9bnox6gpkit6.jpeg!t3w825h0\'/>\r\n我知道，很多姑娘们看到这里，肯定会问裙子哪买的……但我真的不知道……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073615uakbxz3618x1bdvy.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0736157ajvgbrz2t36meew.jpeg!t3w825h0\'/>\r\n让小耳朵站在石凳子上，然后甩动长裙会表现出不一样的动感……人会显得飘逸<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0736157ujuox1o5xetrgz5.jpeg!t3w825h0\'/>\r\n一个转身，一个回眸，一个微笑……只要能抓到情绪,片子就成功一半了<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073616bbkogeac69w9kcf4.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/07361656nqwh8a7hidvzqd.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073616jg690ogcm4qx0p44.jpeg!t3w825h0\'/>\r\n所以，大家记住，拍妹子三要素：颜值 颜值 还是颜值……这是硬件条件，没办法的<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0736173tcusjfl8uyvxd4w.jpeg!t3w825h0\'/>\r\n加上小耳朵的表现力非常的好，第一组的拍摄非常的顺利……一会就完成了<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073618skh3a8amx1e2pyzg.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073618i5mtez9swiephym1.jpeg!t3w825h0\'/>\r\n然后，第二组在海地的凳子上……这里排队等了半天，很多人都是用广角拍摄<br />\r\n结果，会把旁边不相干的人也拍摄进去……所以，我离着很远用长焦！压缩空间<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0736188d6e7qzrqpkcnkux.jpeg!t3w825h0\'/>\r\n这样就得到了一个非常干净的背景……然后妹子，坐的很舒服姿势也就非常的好<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073619vyf1mpgi92idjaxq.jpeg!t3w825h0\'/>\r\n适当的引导，然后等待时机，一张构图 要素都比较好的片子就是这样出来的<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073619bc3xrsinv08ylva3.jpeg!t3w825h0\'/>\r\n然后，我也赶紧跑过去臭屁的自拍一下<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0736198nav6xtat2dcx17d.jpeg!t3w825h0\'/>\r\n可以说，去大理不去双廊，去双廊不去海地，去海地不在凳子上拍2张，就等于白去了……这是很多游客的共识，我比较的无语……到此一游<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073620vjgm3wgfscrsfehy.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0736211f27ip2t0zciwn2p.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/07362291sqe8blknpbyj40.jpeg!t3w825h0\'/>\r\n这个草帽大叔，大家千万别以为是路人甲……这其实是海地精品馆的看门的大叔……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073622ku49jz0eo86gx8hz.jpeg!t3w825h0\'/>\r\n随着，时间的流逝，太阳也下山了……出去游玩的船舶也开始回来<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073622u9420rgosf2rpnaw.jpeg!t3w825h0\'/>\r\n由于云层相当的厚，因此太阳光透过云层很容易会出现丁达尔的耶稣光现象<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0736236ox25v1kcjgiceib.jpeg!t3w825h0\'/>\r\n非常的漂亮……这时候建议大家欠爆一点拍<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/073623ozsftqx169d0rm3t.jpeg!t3w825h0\'/>\r\n然后，搭档的无人机已经把双廊彻底的飞了一遍……吸引了太多人的眼球<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074000hf9e0vpoyb1ndx4w.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074001if7ohdchqdfagog8.jpeg!t3w825h0\'/>\r\n由于苍山的地势影响，很多云会积在苍山上，这样整个云会翻滚积累下来， 非常的霸气<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074001gpc8dfbbmkgjlnbn.jpeg!t3w825h0\'/>\r\n当最后一抹阳光，照在山头上时，天色已经逐渐暗了下来<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074001adts51yo9ttju3zo.jpeg!t3w825h0\'/>\r\n最后一艘渔船，也唱着小曲，慢慢划回来<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074002hz1cjj20e0s6rkra.jpeg!t3w825h0\'/>\r\n在等待日落低色温氛围的同时，来了几个超女神的妹子……一看就是白富美<br />\r\n可惜，没心情勾搭……<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0740029bhk3uegzjpfh764.jpeg!t3w825h0\'/>\r\n然后，利用当时的氛围感，再拍了一组胶片色的人像<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074003mgn7k46kax4knmyi.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/07400385rg8gdlib2a6k91.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074004otye7jz90pc5091z.jpeg!t3w825h0\'/>\r\n很多妹子，都喜欢自己穿着白色的长裙，很仙女的坐在这里……享受着美好的一刻<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074004zs677q8xus3afh2j.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074005bp7m95na55z5m0rn.jpeg!t3w825h0\'/>\r\n可以放空……专心的吹着风，听着洱海的拍打声<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074005ljy5tfkos7cyhy8m.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074005yahck7l5t4zxxez5.jpeg!t3w825h0\'/>\r\n所以，如果你身边有这样的一个妹子……别犹豫，娶了吧<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0740062tx0alkh6kvq6dnt.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074006ubezqavxdj5fwoh9.jpeg!t3w825h0\'/>\r\n好了，太阳终于下山了，天际还留着最后一抹鱼肚白<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074006gcy67i6v5xtfbi5v.jpeg!t3w825h0\'/>\r\n船家也上岸，收拾东西……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074007vzv2geh01jk1gcsh.jpeg!t3w825h0\'/>\r\n如果，不怕下水的话……其实也适合拍几张的<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0740073xkrakuh7zr6520g.jpeg!t3w825h0\'/>\r\n利用低色温的背景，可以和暖色调的人像前景形成鲜明的色彩对比<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0740074r4px5jaydlm6b28.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074008y2zbii63jlr2qm6v.jpeg!t3w825h0\'/>\r\n虽然，站在水里比较的凉，但是感觉是非常好的<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074008lojmzhavtb1jdw2d.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074008mttz6sehckgwayt3.jpeg!t3w825h0\'/>\r\n简单吃过饭后，可以在双廊洱海沿岸找个安静的咖啡屋，静静的欣赏着洱海月<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074009b7l478rl3inydzhp.jpeg!t3w825h0\'/>\r\n洱海的，夜景非常的美，一轮新月半挂在空中，非常的醒目，点上一杯饮料，准备一瓶花露水，你就可以坐在室外好好的发一个小时呆了<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074009bnu1xpqi05nxtam3.jpeg!t3w825h0\'/>\r\n期间，让小耳朵试试超广的大头人像……哈哈哈<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074009nh8h00xsige9tyjj.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074011s4mxvh4avd9pr84o.jpeg!t3w825h0\'/>\r\n夜深人静……自带妹纸的或者找到艳遇已经去啪啪啪了，但我这种单身狗……还是对星空更感兴趣，洱海的星空没想到也这么通透和清楚<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074011cs3oictnyvm31fg2.jpeg!t3w825h0\'/>\r\n尝试了很多种拍摄手法<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074011r7525dxxi658jcj3.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074012gaqhww9eek9go9h5.jpeg!t3w825h0\'/>\r\n夜声人静，我带着随身的蓝牙小音箱，悠闲的放着这篇游记的背景音乐，3瓶风花雪月就可以和陌生人聊到半夜……<br/>\r\n而我们在这里也认识了来自海南的小影……然后几个人一起看银河，聊到半夜<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074012zuwifrr9zb9mwsnc.jpeg!t3w825h0\'/>\r\n顺便可以拍拍星轨……<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0743023999xfqpa2zgqdwr.jpeg!t3w825h0\'/>\r\n夜晚，银河终于升了起来，海地这时候是连鬼都没的……非常的时候拍银河<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074303h91r7badhbjv37a1.jpeg!t3w825h0\'/>\r\n这时候来了一对小情侣，对我这个单身狗造成了10000点的伤害……不过，是个适合做前景的好素材，然后就有了下图的这张银河洱海人像，建议大家点击看大图……小情侣，看到图后当场就跪了……没办法，遇到我也算是缘分和你们运气好吧<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074303dail79qdsnf6o4kd.jpeg!t3w825h0\'/>\r\n收工回去睡觉前……拍了一张视野开阔的洱海银河……非常的满意<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074303jmvf4ekqczryi483.jpeg!t3w825h0\'/>\r\nD4 双廊-挖色-大理<br />\r\n话说昨晚，客栈里一个海南小姑娘过生日，大家一起庆祝到大半夜，结果我还是6点强行把自己拉了起来……因为，外面太阳公公已经出来鸟了……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074304hju2rzcpp7zem6yx.jpeg!t3w825h0\'/>\r\n一早去，果然木有人……我一个人安静的看着洱海，远处是早上去看日出的游船，30元一个人，可以划到湖中央去看日出<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074304wa6avebd56fymiwg.jpeg!t3w825h0\'/>\r\n哈哈哈，还好我带了三脚架……虽然有点麻烦，但无疑是最靠谱的，请无视我右边凌乱的头发，没吹干就睡了……<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0743045vhkvet5aqolnz9m.jpeg!t3w825h0\'/>\r\n随着，太阳不断的升起，游船也开始返回……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074305drsbmkzz0zockcuh.jpeg!t3w825h0\'/>\r\n然后，我赶紧跑到海地旁边一个圈起来的场景，据说这地方是曾经拍电影的取景地……所以，一人2元收费……我去的太早木有人<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0743055626xj807m7v5bos.jpeg!t3w825h0\'/>\r\n说实话，能在这吃早餐，这个感觉也是极好的……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074306plymvlz6tpix7d0i.jpeg!t3w825h0\'/>\r\n所有的游船基本上都已经结束了行程，开始往回赶……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074306ssdapo1z1zhvw18r.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074306yxiwiuxnd1srdntq.jpeg!t3w825h0\'/>\r\n浩浩荡荡的，最起码有30多艘，这个要到时候看我搭档的航拍才清楚了<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074307u04mtqzllhbflwgs.jpeg!t3w825h0\'/>\r\n果不其然，这些人一上岸……就冲到海地来拍照……哎<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/07430734shen69tjbwxwb6.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074307umr01ckdj1kl9ogz.jpeg!t3w825h0\'/>\r\n趁着还有性质，我沿着小巷子往北走，一直走到南诏风情岛附近<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074308vvdus3rmrcflcnai.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0743089yygoa2ptu7h688e.jpeg!t3w825h0\'/>\r\n不过，我对这小岛没啥兴趣所以就不上去了<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074308o2aa0l64k4dgwz7c.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074309wkhxnny12awfuae0.jpeg!t3w825h0\'/>\r\n然后，逛了双廊一圈不想走回去了，随便找了艘船，打算直接划到海地那上岸回客栈……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074309rv805w38qvrc8dpe.jpeg!t3w825h0\'/>\r\n因此，在船上我们就可以另一种视角来看双廊，到处都是客栈旅馆<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074310fsexvltg69qywgfm.jpeg!t3w825h0\'/>\r\n像下图的这种面朝洱海的海景房，基本都是上千一晚的……露天大浴缸，全景玻璃，都有……&amp;<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074310zche89bgqf4utz4j.jpeg!t3w825h0\'/>\r\n基本可以看得出，都是三层楼的格局，根据老房子改建的多<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0743118zyhr830rjl1tqvt.jpeg!t3w825h0\'/>\r\n然后，也有很多咖啡馆，可供大家休息……感觉非常的像海边的度假区了……但是，对着的其实还是个湖，所以有点怪怪的……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074311aes0idirvjtojf1b.jpeg!t3w825h0\'/>\r\n回到客栈，休息下……准备租电动车继续环湖……这次是环<a href=\"http://haidong.8264.com\" class=\"keyword\" target=\"_blank\">海东</a>路……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074311b5ab7x9vdh1o27up.jpeg!t3w825h0\'/>\r\n我们选的都是50元的比较大型的电动车……能跑60公里，洱海环湖是120公里总共……<br />\r\n所以，一辆电动车环湖是不可能的……<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074312jz0hp38me9qsvfyo.jpeg!t3w825h0\'/>\r\n嘿嘿，一骑电动车我的逗比基因就发作了……哈哈<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074312owug5mg5h30o5m4h.jpeg!t3w825h0\'/>\r\n大家千万注意，一定要做好防晒措施，不然你就等着回来掉皮吧……然后一定要带墨镜<br />\r\n为啥？防止风大吹的眼睛睁不开，然后犯困……我就差点困的一瞬间，失去意识，还好<br />\r\n没出事……赶紧停下来，压压惊…<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074313sdqdiden1d4iem83.jpeg!t3w825h0\'/>\r\n在洱海一定要骑电动车，不过两人一起的话，电池会不经用的多<br />\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0743138ua0ydyj55sntc78.jpeg!t3w825h0\'/>\r\n从双廊出发往挖色开，一路的风景都不错，很开阔<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0743135io6or4svucmtukm.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074641t4opghmmmxa96zie.jpeg!t3w825h0\'/>\r\n找到一个合适的场景，有荷花，有小船，然后我就让小耳朵走到船头坐好摆好姿势……感觉非常的赞，这里收费拍照5元一位……<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074641x2r1ff36f5ap53sa.jpeg!t3w825h0\'/>\r\n通过广角来展现大场景，人小一点无所谓，毕竟用长焦盲目把背景虚化，谁知道你来的是大理对吧<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074641znankkm9wdqfjf3o.jpeg!t3w825h0\'/>\r\n老天非常的眷顾，正好一束光洒了过来，照在小耳朵身上，光线和场景非常的应和<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/0746420f1giea8jjcebjtn.jpeg!t3w825h0\'/>\r\n不得不说，这个场景还是很适合拍照的<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074642rzrrxpo23h1aimc9.jpeg!t3w825h0\'/>\r\n最后尝试了一下电影质感的色调，感觉也还不错<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074643xje3b21sadlpb0xp.jpeg!t3w825h0\'/>\r\n沿着环海东路继续往南，这里的视野要比环海西路开阔的很多，虽然没有很多靠海的岸边，但也能临水<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074643znc4uuwe56xu2eoj.jpeg!t3w825h0\'/>\r\n光这一份天，就值得来此旅行了<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074643kghvdxgr3wsnctdc.jpeg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074644d1hx7gy2gqjkqxnb.jpeg!t3w825h0\'/>\r\n再不到挖色镇的一个小山头，会看到一个亭子，但是亭子不是重点，重点是下方有一处去的人少的岸边<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074644huzdlfl9aru5ptmp.jpeg!t3w825h0\'/>\r\n就是这里，有树，有岸边……环境非常的好，人还不多<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy preview\' data-original=\'http://image1.8264.com/forum/201805/07/074645nqn2zx6lwu884nne.jpeg!t3w825h0\'/>\r\n在这里，找石头扔湖面，看着泛起点点涟漪是很童年的感觉', '2018-05-07 17:45:49', 'http://image1.8264.com/forum/public/20180507/5:4/152567711035.jpg!w168h106', 'makiori');
INSERT INTO `artical` VALUES ('4', '稻城亚丁   身在地狱，心在天堂', '据说在很久、很久以前，在青藏高原的雪山深处，有一个被双层雪山环抱的隐秘王国。<br />\r\n那里有雪山、冰川、峡谷、森林、草甸、湖泊、河流、金块、宝石、牛羊、和最清纯的空气，这个王国就叫香巴拉王国。<br />\r\n在藏传佛教的经典中，像这样美丽、明朗、宁静、和谐的“净土”就被称为香格里拉。<br />\r\n最神奇的传说是有三大菩萨的真身居住在这里，那就是驰名藏区的稻城神峰。<br />\r\n由三座完全隔开，但相距不远，呈“品”字形排列的雪峰组成：北峰仙乃日，意为观世音菩萨，海拔六千零三十二米；南峰央迈勇，意为文殊菩萨，海拔五千九百五十八米；东峰夏诺多吉，意为金刚手菩萨，海拔和南峰基本相等。<br />\r\n方圆占地近千平方公里，终年冰封雪锁，“属众生供奉朝神积德之圣地”，曾经五世达赖为其开光加封。其苍劲雄奇，状如珠穆朗玛峰；其艰险诡秘，远胜梅里雪峰；仙乃日雍容大度，慈善安详；央迈勇如端庄少女，冰清玉洁；夏诺多吉像英俊少年，神采奕奕。<br />\r\n三尊护法守卫在这里的天空与大地之间，在神界和人界，维持了一方净土。无数野羊、獐子、猴子、麂鹿、黑熊这些大自然的生灵都悠然自得，欢畅嬉戏在林间草莽，被当地人尊为山神。和人类在这里和睦相处，同享生之乐趣。<br/>\r\n稻城机场<br />\r\n稻城亚丁机场，海拔高度4411米，按照中国民航局的界定，海拔高度在2438米以上的机场为高高原机场。航空专家、空军指挥学院战略教官徐勇凌介绍，在高高原上飞行的飞机发动机，都针对稀薄氧气做过适应性改装。在亚丁机场的验证飞行中，机组人员都佩戴着氧气面罩驾驶客机。机场跑道长4,200米（13,780英尺），飞行区等级4C，包括4个停机坪，候机楼建筑面积8,796平方米。海拔4,411米（14,472英尺），超过海拔4,334米（14,219英尺）的<a href=\"http://xz.8264.com\" class=\"keyword\" target=\"_blank\">西藏</a><a href=\"http://changdu.8264.com\" class=\"keyword\" target=\"_blank\">昌都</a>邦达机场，成为世界<a href=\"http://sh.8264.com\" class=\"keyword\" target=\"_blank\">上海</a>拔最高的民用机场。已于2012年8月29日竣工，11月23日试航成功。2013年9月16日正式通航，首航是中国国际航空4215号航班，由一架A319型客机搭载着118名旅客来到稻城。预计在2020年旅客吞吐量达到28万人次，货物吞吐量1,400吨。<br />\r\n来这里要注意高原反应，要在飞来之前一周开始服用红景天或带上速效的奥默携氧片，预防高原反应。<br />\r\n车子是借318工程队的，这几天就开这车了~<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766085339.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766085459.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766085438.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766085525.jpg!t3w825h0\'/>\r\n稻城<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766085661.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766085635.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766085796.jpg!t3w825h0\'/>\r\n香格里拉镇<br />\r\n由于是临时起行，没有预定酒店，入住亚丁驿站，国庆期间这里的酒店好贵啊<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766085855.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766085954.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766086064.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766086140.jpg!t3w825h0\'/>\r\n在<a href=\"http://hanguo.8264.com\" class=\"keyword\" target=\"_blank\">韩国</a>买的自拍杆派上用场了<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766086125.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766086260.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766086286.jpg!t3w825h0\'/>\r\n酒店晚上的篝火晚会<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766086392.jpg!t3w825h0\'/>\r\n洛绒牛场、牛奶海、五色海<br />\r\n藏民自古以来奉这里为神山，藏族佛名叫三怙主雪山。<br />\r\n在世界佛教二十四圣地中排名第十一位。在做法会时你可以看到，一条悠长险绝的山路，穿越喧嚣的红尘，向着天堂延伸。<br />\r\n远远近近朝圣的善男信女们，扶老携幼，口中低诵经文，有的摇着转经筒，眼里闪烁着敬畏、虔诚、质朴的光。<br />\r\n组成一队队无比忠实的朝拜大军，不辞辛苦从遥远的地方，艰难跋涉而来，只为双脚能踏上这块圣洁之宝地，奉献身心地为之叩首。他们在向神山参拜，向苍天和大地祈祷，祈求健康，祷告幸福。参拜者常常络绎不绝。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766086321.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/1527660864100.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766086572.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766086570.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766086684.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766086711.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766086790.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766086886.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766086814.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766086969.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766087098.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766087162.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766087174.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766087280.jpg!t3w825h0\'/>\r\n走累了，脱下鞋子晒晒太阳~<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766087243.jpg!t3w825h0\'/>\r\n国庆期间，<a href=\"http://bbs.8264.com/forum-forumdisplay-fid-7-typeid-1171-filter-typeid.html\" class=\"keyword\" target=\"_blank\">帐篷</a>也超贵。。。。<br/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766087480.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766087425.jpg!t3w825h0\'/>\r\n其实我们还算来早了，要是再来晚15天，对面的山，更加色彩鲜艳！<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766089120.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766089333.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766089356.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766089441.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766089542.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766089590.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766089691.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766089724.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766089833.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766089817.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766089995.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766090069.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766090092.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766090182.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766090252.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766090328.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766090440.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766090479.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766090528.jpg!t3w825h0\'/>\r\n青蛙海<br />\r\n看了很多稻城亚丁的游记，很少提及青蛙海的，青蛙海还属于未开发景点，据当地藏族人介绍，他们在5月份的时候会在青蛙海挖虫草，那边还有一个小青蛙海，蝌蚪海呢<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766090597.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766090682.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766090657.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766090778.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766090837.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766090966.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766090953.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766091015.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766091092.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766091179.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766091215.jpg!t3w825h0\'/>\r\n<img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766091380.jpg!t3w825h0\'/>\r\n我们2014年国庆去的稻城亚丁，第一天玩五色海、牛奶海，第二天珍<a href=\"http://zhuhai.8264.com\" class=\"keyword\" target=\"_blank\">珠海</a>、第三天青蛙海，前两天太多游记写了，就不多说，只上图，青蛙海由于未开发，路险，岔路口多，所以还是建议<a href=\"http://hd.8264.com/xianlu-63-0-0-0-1-1?from=keyword\" class=\"keyword\" target=\"_blank\">骑马</a>去（强烈建议不用请导游，马夫会路的，国庆期间一匹马大概200元左右），往返大概4个小时，路上景色绝美，最重要的是，10月2日国庆假期期间，我们从8点半上山，到12点半下山，整个期间，我们没见其他旅客 <img src=\'http://static.8264.com/static/images/forum/readmodelTravel/loadding.jpg\' class=\'lazy \' data-original=\'http://image1.8264.com/wen/public/20180530/152766090597.jpg!t3w825h0\'/>', '2018-05-30 20:37:05', 'http://image1.8264.com/forum/public/20180530/5:4/152767333591.jpg!w168h106', 'jk');
